import React from "react";

import Grid from "@mui/material/Grid";
import { Box, Card, CardContent, Typography } from "@mui/material";
import Calendar from "../component/Calendar";
import { BarChart } from "@mui/x-charts/BarChart";
// import { Tooltip } from "@mui/x-charts/Tooltip";
const uData = [4000, 3000, 2000, 2780, 1890, 2390, 3490];
const pData = [2400, 1398, 9800, 3908, 4800, 3800, 4300];

const xLabels = [
  "Page A",
  "Page B",
  "Page C",
  "Page D",
  "Page E",
  "Page F",
  "Page G",
];

export default function Dash2() {
  return (
    <div>
      <Grid container spacing={2} alignItems="stretch">
        <Grid item xs={4}>
          <Card
            variant="outlined"
            sx={{ backgroundColor: "#2b2f33", borderRadius: 2 }}
          >
            <CardContent>
              <Grid container spacing={2} alignItems="stretch">
                <Grid item xs={8} sx={{ p: 2 }}>
                  <Box
                    sx={{
                      display: "flex",
                      justifyContent: "flex-center",
                      backgroundColor: "",
                    }}
                  >
                    <h2>Total Tasks</h2>
                  </Box>
                  <Box
                    sx={{
                      display: "flex",
                      justifyContent: "flex-start",
                      backgroundColor: "",
                      mt: 2,
                    }}
                  >
                    <h1>10</h1>
                  </Box>
                </Grid>
                <Grid item xs={4}>
                  <Box
                    sx={{
                      display: "flex",
                      justifyContent: "flex-end",
                      backgroundColor: "",
                    }}
                  >
                    <h2>
                      <i className="fa-solid fa-list-check"></i>
                    </h2>
                  </Box>
                </Grid>
              </Grid>
            </CardContent>
          </Card>
        </Grid>
        <Grid item xs={4}>
          <Card
            variant="outlined"
            sx={{ backgroundColor: "#2b2f33", borderRadius: 2 }}
          >
            <CardContent>
              <Grid container spacing={2} alignItems="stretch">
                <Grid item xs={8} sx={{ p: 2 }}>
                  <Box
                    sx={{
                      display: "flex",
                      justifyContent: "flex-center",
                      backgroundColor: "",
                    }}
                  >
                    <h2>Complete Tasks</h2>
                  </Box>
                  <Box
                    sx={{
                      display: "flex",
                      justifyContent: "flex-start",
                      backgroundColor: "",
                      mt: 2,
                    }}
                  >
                    <h1>10</h1>
                  </Box>
                </Grid>
                <Grid item xs={4}>
                  <Box
                    sx={{
                      display: "flex",
                      justifyContent: "flex-end",
                      backgroundColor: "",
                    }}
                  >
                    <h2>
                      {/* <i className="fa fa-tasks h1 " aria-hidden="true"></i> */}
                      <i className="fa-solid fa-clipboard-list"></i>
                    </h2>
                    {/* <i class="fa fa-list-alt" aria-hidden="true"></i> */}
                  </Box>
                </Grid>
              </Grid>
            </CardContent>
          </Card>
        </Grid>
        <Grid item xs={4}>
          <Card
            variant="outlined"
            sx={{ backgroundColor: "#2b2f33", borderRadius: 2 }}
          >
            <CardContent>
              <Grid container spacing={2} alignItems="stretch">
                <Grid item xs={8} sx={{ p: 2 }}>
                  <Box
                    sx={{
                      display: "flex",
                      justifyContent: "flex-center",
                      backgroundColor: "",
                    }}
                  >
                    <h2>Incomplete Tasks</h2>
                  </Box>
                  <Box
                    sx={{
                      display: "flex",
                      justifyContent: "flex-start",
                      backgroundColor: "",
                      mt: 2,
                    }}
                  >
                    <h1>10</h1>
                  </Box>
                </Grid>
                <Grid item xs={4}>
                  <Box
                    sx={{
                      display: "flex",
                      justifyContent: "flex-end",
                      backgroundColor: "",
                    }}
                  >
                    {/* <i className="fa-solid fa-clipboard-list"></i> */}
                    <h2>
                      {/* <i className="fa fa-tasks h1 " aria-hidden="true"></i> */}
                      <i class="fa fa-list-alt" aria-hidden="true"></i>
                    </h2>
                  </Box>
                </Grid>
              </Grid>
            </CardContent>
          </Card>
        </Grid>

        <Grid item xs={8}>
          <Card sx={{ backgroundColor: "#2b2f33" }}>
            <CardContent sx={{}}>
              {/* <Box sx={{ ml: 7, cursor: "pointer" }}>
                <BarChart
                  xAxis={[
                    {
                      scaleType: "band",
                      data: ["group A", "group B", "group C"],
                    },
                  ]}
                  series={[
                    { data: [4, 3, 5] },
                    { data: [1, 6, 3] },
                    { data: [2, 5, 6] },
                  ]}
                  width={600}
                  height={385}
                />
              </Box> */}
              <BarChart
                width={500}
                height={300}
                series={[
                  {
                    data: pData,
                    label: "pv",
                    id: "pvId",
                    yAxisKey: "leftAxisId",
                  },
                  {
                    data: uData,
                    label: "uv",
                    id: "uvId",
                    yAxisKey: "rightAxisId",
                  },
                ]}
                xAxis={[{ data: xLabels, scaleType: "band" }]}
                yAxis={[{ id: "leftAxisId" }, { id: "rightAxisId" }]}
                rightAxis="rightAxisId"
              />
            </CardContent>
          </Card>
        </Grid>
        <Grid item xs={4} sx={{ border: 0 }}>
          <Card sx={{ backgroundColor: "#2b2f33" }}>
            <CardContent sx={{ ml: 3 }}>
              <Calendar />
            </CardContent>
          </Card>
        </Grid>
      </Grid>
    </div>
  );
}
